import React, { useState } from 'react';
import InputNumber from './InputNumber';
import NameGenerator from './NameGenerator';

function App() {
  const [numNames, setNumNames] = useState(1);

  const handleInputChange = (event) => {
    setNumNames(event.target.value);
  };

  return (
    <div>
      <h1>D&D Name Generator</h1>
      <InputNumber value={numNames} onChange={handleInputChange} />
      <NameGenerator numNames={numNames} />
    </div>
  );
}

export default App;
